/*
 * @Author: your name
 * @Date: 2022-03-31 23:07:52
 * @LastEditTime: 2022-04-02 10:54:29
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\layouts\SpareManage\StandingPage\index.js
 */
import { inject, observer } from 'mobx-react'
import React, { Component } from 'react'
import {NavLink } from 'react-router-dom';
import { Table } from 'antd'
import {Button,Select,Option } from 'antd';


@inject('SpareStore')
@observer
class StandingPage extends React.Component {
  render() {
    const { columns } = this.props.SpareStore;
    const { data } = this.props.SpareStore;
    return <div>
      <Select defaultValue="lucy" style={{ width: 180, float: 'left' }}>
        <Option value="jack">直接提交数据</Option>
        <Option value="lucy">提交并管理本人数据</Option>
        <Option value="disabled">管理全部数据</Option>
        <Option value="Yiminghe">查看全部数据</Option>
      </Select>
      <NavLink to='/edit' style={{ float: 'right' }}><Button type='primary'>编辑表单</Button></NavLink>
      <Table columns={columns} dataSource={data}></Table>
    </div>;

  }
}

export default StandingPage;
